class Node():
    def __init__(self, value, occurences=1):
        self.value = value
        self.occurences = occurences
        self.next = None
        self.prev = None

class Num_List():
    def __init__(self):
        self.head = None
        self.tail = None

    def add_value(self, value):
        node = Node(value)
        if not self.head:
            self.head = node
            return 0
        if value < self.head.value:
            node.next = self.head
            node.next.prev = node
            self.head = node
            return 0
        else:
            count = 0
            current = self.head
            while current.value < value:
                if current.value < value:
                    count += current.occurences
                if current.next == None:
                    current.next = node
                    node.prev = current
                    self.tail = node
                    return count
                current = current.next
            if current.value == value:
                current.occurences += 1
                return count
            if current.value > value:
                current.prev.next = node
                node.prev = current.prev
                node.next = current
                current.prev = node
                return count

    def show_list(self):
        result = []
        node = self.head
        while node:
            result.append({
                "value": node.value,
                "occurences": node.occurences
            })
            node = node.next
        return result

def smaller(arr):
    tracker = Num_List()
    result = []
    for i in range(len(arr) - 1, -1, -1):
        total = tracker.add_value(arr[i])
        result.insert(0, total)
    # pprint(tracker.show_list())
    return result


